function resizeimg($filename, $smallimage, $w, $h){
	
  $size_img = getimagesize($filename);
  $ratio = $w / $h;
  if($size_img[0] < $w && $size_img[1] < $h){ return true; }
  $src_ratio = $size_img[0] / $size_img[1];
  if($ratio > $src_ratio){
    $h = $w / $src_ratio;
  }else{ $w = $h * $src_ratio; }
  $dest_img = imagecreatetruecolor($w, $h);
  $white = imagecolorallocate($dest_img, 255, 255, 255);
  if($size_img[2] == 2){
    $src_img = imagecreatefromjpeg($filename);
  }elseif($size_img[2] == 1){
    $src_img = imagecreatefromgif($filename);
  }elseif($size_img[2] == 3){ $src_img = imagecreatefrompng($filename); }
  imagecopyresampled($dest_img, $src_img, 0, 0, 0, 0, $w, $h, $size_img[0], $size_img[1]);
  if($size_img[2] == 2){
    imagejpeg($dest_img, $smallimage);
  }elseif($size_img[2] == 1){
    imagegif($dest_img, $smallimage);
  }else if($size_img[2] == 3){ imagepng($dest_img, $smallimage); }
  imagedestroy($dest_img);
  imagedestroy($src_img);
  return true;
  
}


function rdir ($path2dir) {
    $d = dir ($path2dir);  
 
    while (false !== ($entry = $d->read())) {  
 
        if ($entry!='.' && $entry!='..' && $entry!='' ) {
            $all_path = $path2dir.$entry;
            $new_path = go ($all_path, is_file($all_path));  
 
            if (!is_file($all_path)) {
                if (!rdir ($new_path)) {
                    return false;
                }
            }
        }
    }  
 
    return true;
}
 
function go ($path2file, $is_file = true) {  
 
    if ($is_file) {  
 
        # выполняем операцию над файлом
        # выведем относительный путь к обрабатываемому файлу
       // echo $path2file,"\n";  
 
 $m1=explode("/",$path2file);
 
 $name_small_file=array_pop($m1); 
 
// echo "==".$name_small_file."==";
 
 
        # установим необходимые права на файл
        //if (!chmod($path2file,0666)) {
         //   return false;
        //}  
		
