//	{
	
	if (!is_file('images/small/'.$name_small_file)){
	
    	$image = imagecreatefromjpeg($path2file);		
    	$orig_width=imagesx($image);
    	$orig_height=imagesy($image);
    	$width = $orig_width;
    	$height = $orig_height;
    	$max_height=250;
    	$max_width=50;
    	if ($height > $max_height) {
        	$width = ($max_height / $height) * $width;
        	$height = $max_height;
    	}
    	if ($width > $max_width) {
        	$height = ($max_width / $width) * $height;
        	$width = $max_width;
    	}
    	$image_s = imagecreatetruecolor($width, $height);
    	imagecopyresampled($image_s, $image, 0, 0, 0, 0, $width, $height, $orig_width, $orig_height);
		mkdir('images/small', 0777, true);
    	imagejpeg ($image_s, 'images/small/'.$name_small_file, 90);
		
	
	}
	
	
	
/////////////-------------------------------------////////////////////////	



		
 
