<p style="font-size: 14px;" class="font_8"><em>2 марта 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px;">&nbsp;</p>

<p class="font_8" style="font-size: 16px;"><span style="font-size:16px;">В этом году мы выходим за пределы России.&nbsp; </span>Весной&nbsp; <span style="font-weight:bold;">Libelle станет официальным партнером Сборной России на Юниорском Блэкпульском Фестивале 2015 в Англии.</span> Сроки проведения Фестиваля с 3 по 12 апреля.</p>

