t: 144px; object-fit: cover;" src="https://static.wixstatic.com/media/ef42e7_5899ab80e641478b9fbc708954236cef.jpg/v1/fill/w_980,h_504,al_c,q_75,usm_0.50_1.20_0.00/ef42e7_5899ab80e641478b9fbc708954236cef.jpg" id="iarx635qimgimage" class="s4imgimage" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iarx635q.0.0.0"></div></a></div><div style="top: 10515px; left: 20px; width: 280px; height: 5px; position: absolute;" class="s13" id="iarv3dms" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iarv3dms"><div id="iarv3dmsline" class="s13line" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iarv3dms.0"></div></div><div style="top: 8108px; left: 24px; width: 280px; position: absolute;" class="s2" id="iarv3dmv" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iarv3dmv"><h6 style="font-size: 26px;" class="font_6">Libelle на турнирах в Италии</h6>

<p style="font-size: 14px;" class="font_8"><em>11 июня 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Команда Libelle продолжает свое движение по Европе. На этот раз наши стилисты едут сразу на два турнира. Первый –&nbsp; <span style="font-weight:bold;">Открытый Чемпионат Италии </span></span></span><span style="font-weight:bold;">(XXXI I.O.C. ITALIAN OPEN CHAMPIONSHIP - FE.IN.DA. 2015</span>)<span style="font-size:16px;"><span style="line-height:1.5em;">, который будет проходить с<span style="font-weight:bold;"> 26 по 28 июня 2015 г.</span></span></span>&nbsp; в Palazzetto dello Sport, Риччоне (Riccione).</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Второй турнир – FESTIVALDANZA – состоится в Palazzetto dello Sport,Via Пинарелла, 66, Червия РА (Cervia RA) в период с <span style="font-weight:bold;">25 по 28 июня 2015 г</span>.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">О том, как все прошло, мы обязательно вам расскажем в наших отчетах.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p style="font-size: 16px;" class="font_7">(сайты мероприятий http://www.italianopenchampionship.com/</p>

