R.1.1.$SITE_PAGES.$c1f8f.1.$ic0kum87.0"><div id="ic0kum87img" style="width:280px;height:280px;position:relative;" class="s4img" data-state="loaded" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ic0kum87.0.0"><img alt="" style="width: 280px; height: 280px; object-fit: cover;" src="https://static.wixstatic.com/media/ef42e7_f43f479157214d65b868be93b3d84f5f.jpg/v1/fill/w_980,h_980,al_c,q_75,usm_0.50_1.20_0.00,lg_1/ef42e7_f43f479157214d65b868be93b3d84f5f.jpg" id="ic0kum87imgimage" class="s4imgimage" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ic0kum87.0.0.0"></div></div></div><div style="top: 7739px; left: 24px; width: 280px; height: 5px; position: absolute;" class="s13" id="ic0dm8ag" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ic0dm8ag"><div id="ic0dm8agline" class="s13line" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ic0dm8ag.0"></div></div><div style="top: 6971px; left: 24px; width: 280px; position: absolute;" class="s2" id="ic0dmqx7" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ic0dmqx7"><h6 style="font-size: 26px;" class="font_6">Libelle на турнирах в Италии - фотоотчет</h6>

<p style="font-size: 14px;" class="font_8"><em>12 июля 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Команда Libelle вернулась из Италии, где в период с 26 по 28 июля проходили сразу два танцевальных мероприятия –&nbsp;</span></span>Открытый Чемпионат Италии (XXXI I.O.C. ITALIAN OPEN CHAMPIONSHIP - FE.IN.DA. 2015)<span style="font-size:16px;"><span style="line-height:1.5em;"> и&nbsp; </span></span>FESTIVALDANZA<span style="font-size:16px;"><span style="line-height:1.5em;">. </span></span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Помимо новых впечатлений и настроения летней зажигательной Италии наши стилисты привезли и множество побед, полученных танцорами, образы которых создавались командой Libelle.</span></span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">И мы готовы показать вам результаты работы наших стилистов на странице ОТЧЕТЫ. </span></span></p>

<p style="font-size: 14px;" class="font_8">&nbsp;</p>

<p style="font-size: 16px;" class="font_7">(сайты мероприятий http://www.italianopenchampionship.com/</p>

<p style="font-size: 16px;" class="font_7">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; http://www.festivaldanzacervia.it/)</p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>
</div><div style="top: 4930px; left: 21px; width: 280px; position: absolute;" class="s2" id="ic0la3t6" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ic0la3t6"><h6 style="font-size: 26px;" class="font_6">Петербургские танцевальные каникулы 2015</h6>

<p style="font-size: 14px;" class="font_8"><em>12 июля 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_7" style="font-size: 16px;line-height: 1.5em;"><span style="line-height:1.5em;"><span style="font-weight: bold;">29-30 августа 2015</span> года в отеле Holiday Inn «Московские ворота» состоится <span style="font-weight: bold;">7-й Международный Открытый фестиваль «Saint Petersburg Dance Holidays 2015»</span>.</span></p>

<p class="font_7" style="font-size: 16px;line-height: 1.5em;"><span style="line-height:1.5em;">Фестиваль пройдет под эгидой Любительской лиги Всемирного Танцевального совета (WDC AL) и Российского танцевального союза (РТС) - национального представителя WDC в России.</span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="line-height:1.5em;">Программа фестиваля очень насыщена. Пары-любители будут исполнять Европейские и Латиноамериканские танцы. Результаты участников во всех возрастных группах будут внесены в общий рейтинг WDC AL.</span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_7" style="font-size: 16px;line-height: 1.5em;"><span style="line-height:1.5em;">Прекрасным подарком от организаторов для всех ценителей и поклонников Бального Танца станет фееричное Супер Шоу шестикратных Чемпионов России ,двукратных Чемпионов Европы среди профессионалов в Латиноамериканской программе:<span class="color_15"> Sergey Surkov &amp; Melia (Russia)</span></span><span style="font-size:16px;"><span style="line-height:1.5em;">. </span></span></p>

<p class="font_7" style="font-size: 16px;line-height: 1.5em;">&nbsp;</p>

<p class="font_7" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Мастера Libelle из Москвы и Санкт-Петербурга также примут участие в фестивале для&nbsp; создания ярких и неповторимых образов танцоров.</span></span></p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;"><span style="font-size:16px;"><span style="line-height:1.5em;">По итогам фестиваля - с нас фотоотчет :)</span></span></p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p style="font-size: 16px;" class="font_7">(источник http://spdu.spb.ru/pro-am/spb-dance-holidays-2015/)</p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>
