<p style="font-size: 14px;" class="font_8"><em>7 августа 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Теперь у нас есть не только фото, но и видео. На страничке с соответствующим названием мы выложили ролики с фестивалей, проходивших в Италии (</span></span>Открытый Чемпионат Италии и&nbsp; FESTIVALDANZA).</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Видеоролики доступны для просмотра и в мобильной версии.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">(Видеоматериалы предоставления танцевальной студией "АPRIORI").</p>

<p style="font-size: 14px;" class="font_8">&nbsp;</p>
</div><div style="top: 6661px; left: 23px; width: 280px; height: 5px; position: absolute;" class="s13" id="idpyuh0r" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$idpyuh0r"><div id="idpyuh0rline" class="s13line" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$idpyuh0r.0"></div></div><div style="top: 40px; left: 12px; width: 280px; height: 5px; position: absolute;" class="s13" id="idpz926h" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$idpz926h"><div id="idpz926hline" class="s13line" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$idpz926h.0"></div></div><div style="top: 3256px; left: 13px; width: 280px; position: absolute;" class="s2" id="idpyuhuu" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$idpyuhuu"><h6 style="font-size: 26px;" class="font_6">Открытие сезона</h6>

<p style="font-size: 14px;" class="font_8"><em>24 августа 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;"><span style="font-weight:bold;">12-13 сентября в Москве</span> состоится VII Международный фестиваль РТС<span style="font-weight:bold;"> "Осенняя Звезда"</span>, который станет открытием сезона. Место проведения фестиваля - "Дворец спортивных единоборств" ЦСКА, Ленинградский пр., 39.</span></span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Команда Libelle официально представлена в качестве стилистов фестиваля.</span></span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">А <span style="font-weight:bold;">11-12 октября</span> мастера Libelle покажут свое мастерство на <span style="font-weight:bold;">"Одинцовских вечерах"</span>. Мероприятие пройдет в г. Одинцово (МО), ОГИ, ул. Ново-спортивная, д. 3.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Все фотоочеты смотрите на нашем сайте.</p>
