.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iewqrx09.0"><div id="iewqrx09img" style="width:280px;height:396px;position:relative;" class="s3img" data-state="loaded" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iewqrx09.0.0"><img alt="" style="width: 280px; height: 396px; object-fit: cover;" src="https://static.wixstatic.com/media/ef42e7_4879db941484410f8118ebb3466fee9b.png/v1/fill/w_980,h_1386,al_c,usm_0.50_1.20_0.00/ef42e7_4879db941484410f8118ebb3466fee9b.png" id="iewqrx09imgimage" class="s3imgimage" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iewqrx09.0.0.0"></div></a></div><div style="top: 2732px; left: 17px; width: 280px; height: 5px; position: absolute;" class="s13" id="iewqsa7g" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iewqsa7g"><div id="iewqsa7gline" class="s13line" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iewqsa7g.0"></div></div><div style="top: 2216px; left: 17px; width: 280px; position: absolute;" class="s2" id="iewqrx0b" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$iewqrx0b"><h6 style="font-size: 26px;" class="font_6">"Осенняя Москва-2015"</h6>

<p style="font-size: 14px;" class="font_8"><em>23 сентября 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;"><span style="font-weight:bold;">26-27 сентября в Москве</span>&nbsp;</span></span>под эгидой Всемирного Танцевального Совета и Российского Танцевального Союза<span style="font-size:16px;"><span style="line-height:1.5em;"> состоится&nbsp;<span style="font-weight:bold;"> Турнир "Осенняя Москва-2015"</span>. Место проведения турнира - </span></span>спортивный комплекс "Игровой", Ленинградский проспект, д. 39, стр. 76,<br>
(Проезд: м. Аэропорт, последний вагон из центра, перейти на противоположную сторону Ленинградского проспекта)<span style="font-size:16px;"><span style="line-height:1.5em;">.</span></span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Стилисты Libelle будут принимать участие в создании причесок и макияжа танцоров-участников турнира.</span></span></p>

<p style="font-size: 14px;" class="font_8">&nbsp;</p>
</div><div style="top: 840px; left: 20px; width: 280px; height: 396px; position: absolute;" data-exact-height="NaN" data-content-padding-horizontal="0" data-content-padding-vertical="0" title="" class="s3" id="ifaw9rge" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rge"><a style="width:280px;height:396px;cursor:pointer;" href="http://sigmadance.by/CapitalCup2015r.htm" target="_blank" id="ifaw9rgelink" class="s3link" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rge.0"><div id="ifaw9rgeimg" style="width:280px;height:396px;position:relative;" class="s3img" data-state="loaded" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rge.0.0"><img alt="" style="width: 280px; height: 396px; object-fit: cover;" src="https://static.wixstatic.com/media/ef42e7_1c975eb694cb4c9aa9b50b72c6ee83a3.png/v1/fill/w_980,h_1386,al_c,usm_0.50_1.20_0.00/ef42e7_1c975eb694cb4c9aa9b50b72c6ee83a3.png" id="ifaw9rgeimgimage" class="s3imgimage" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rge.0.0.0"></div></a></div><div style="top: 3871px; left: 20px; width: 280px; height: 5px; position: absolute;" class="s13" id="ifaw9rgh" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rgh"><div id="ifaw9rghline" class="s13line" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rgh.0"></div></div><div style="top: 1246px; left: 20px; width: 280px; position: absolute;" class="s2" id="ifaw9rgg" data-reactid=".0.$SITE_ROOT.$mobile_siteRoot.$PAGES_CONTAINER.1.1.$SITE_PAGES.$c1f8f.1.$ifaw9rgg"><h6 style="font-size: 26px;" class="font_6">CAPITAL CUP "MINSK-2015"</h6>

<p style="font-size: 14px;" class="font_8"><em>3 октября 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-size:16px;"><span style="line-height:1.5em;">Совершенно неожиданно команду Libelle пригласили в <span style="font-weight:bold;">Минск</span>, где </span></span><span style="font-weight:bold;">26-27 сентября</span><span style="font-size:16px;"><span style="line-height:1.5em;"> </span></span>проходил турнир<span style="font-size:16px;"><span style="line-height:1.5em;"> <span style="font-weight:bold;">CAPITAL CUP "MINSK-2015"</span>.<span style="font-weight:bold;"> </span>Поскольку все произошло очень быстро, мы не успели анонсировать мероприятие. Но за то уже сейчас готовы показать вам фотоотчет турнира и поделиться той атмосферой радости и красоты, что царила во время подготовки участников к выступлению.</span></span></p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">(источник: http://sigmadance.by/CapitalCup2015r.htm).</p>

<p style="font-size: 14px;" class="font_8">&nbsp;</p>
