<p style="font-size: 14px;" class="font_8"><em>14 октября 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">С <span style="font-weight:bold;">19 по 25 октября 2015 г.</span> <span style="font-weight:bold;">в Москве</span> пройдет турнир <span style="font-weight:bold;">"ДЭНС АККОРД-2015".</span> Мы с удовольствием будем рады вас видеть на этом крупнейшем турнире. Место проведения -&nbsp; Крокус Экспо. На турнире будет работать имидж-студия Libelle, которая поразит вас своим мастерством и скоростью в создании бально-спортивного образа.</p>

