<p style="font-size: 14px;" class="font_8"><em>April 16, 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Open International Pro Am competition in ballroom dancing Daikin Champions' Ball - 2015 will be held on April 25-26, where Libelle team will work as stylists.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Daikin Champions' Ball - it's amazing sets, impressive special effects, live music. In a judging panel there will be only national champions and multiple world and European champions, not only in ballroom dancing, but also in the programs of other dance styles.&nbsp;&nbsp; Grodno Philharmonic Symphonic Orchestra conducted by Boris Myagkov will traditionally accompany participants.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">The main present for the participants and spectators of the Champions Ball&nbsp; will be the arrival of luxury dancing couple - Ricardo Cocchi and Yulia Zagoruichenko who recently in Paris won the world title in the Latin American program for the fifth time.<br>
(source: http://championsball.dance.ru/)</p>
