S_CONTAINER.1.1.$SITE_PAGES.$c16v1.1.$ia5cizx0"><h6 style="font-size: 26px;" class="font_6">Libelle in St. Petersburg</h6>

<p style="font-size: 14px;" class="font_8"><em>May 26, 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Finally! Branch of Image Studio Libelle was opened in St. Petersburg.<br>
The opening of the branch was timed to May Dance Classic-2015, was held 16-17 May 2015 in St. Petersburg.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Libelle Team at the opening were the leading make-up artist Tatiana Sidorova (St. Petersburg), a leading master on male hairstyles Eugene Kolbin (Moscow) and a leading&nbsp;hairstyles Anna Fenko&nbsp; (St. Petersburg).</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">Many of the dancers, whose images were created by masters Libelle, won a prize.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">On the page REPORTS&nbsp; you can find images of dancers made by our masters.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">&nbsp;</p>

