<p style="font-size: 14px;" class="font_8"><span style="font-style:italic;">July 12, 201</span></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_7" style="font-size: 16px;line-height: 1.5em;"><span style="font-weight:bold;">August 29-30, 2015</span> in Hotel Holiday Inn «Moscow Gates" will be held</p>

<p class="font_7" style="font-size: 16px;line-height: 1.5em;">the <span style="font-weight:bold;">7th International Open Festival «Saint Petersburg Dance Holidays 2015"</span>.<br>
<br>
The festival will be held under the auspices of the Amateur League World Dance Council (WDC AL) and the Russian Dance Union (RTS) - a national representative WDC in Russia.<br>
<br>
The festival program is very rich. Pairs amateurs will perform European and Latin American dances. The results of the participants in all age groups will be included in the overall ranking WDC AL.</p>

<p style="font-size: 14px;" class="font_8">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;"><span style="font-size:16px;"><span style="line-height:1.5em;">A perfect gift from the organizers for all lovers and fans of ballroom dancing will be the enchanting Super Shows six-time champion of Russia, twice European champion among professionals in the Latin American program: Sergey Surkov &amp; Melia (Russia).<br>
<br>
Masters of Libelle team from Moscow and St. Petersburg will also take part in the festival for creating bright and unique images of dancers.<br>
<br>
At the end of the festival - photo report.</span></span></p>

