<p style="font-size: 14px;" class="font_8"><em>September 23, 2015</em></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;"><span style="font-weight:bold;">September </span><span style="font-size:16px;"><span style="line-height:1.5em;"><span style="font-weight:bold;">26-27&nbsp;</span></span></span> Moscow will host the tournament <span style="font-weight:bold;">Autumn Moscow Cup-2015</span>.</p>

<p class="font_8" style="line-height: 1.5em; font-size: 16px;">The tournament will be held under the auspices of the World Dance Council and the Russian Dance Union. Venue - a sports complex "Igrovoy", Leningradsky prospect, 39, bdg 76,<br>
