<p style="font-size: 14px;" class="font_8"><span style="font-style:italic;">October 3, 2015</span></p>

<p style="font-size: 16px;" class="font_7">&nbsp;</p>

<p class="font_8" style="font-size: 14px;line-height: 1.5em;">&nbsp;</p>

<p class="font_8" style="font-size: 16px; line-height: 1.5em;">Unexpectedly Libelle team was invited to Minsk<span style="font-size:16px;"><span style="line-height:1.5em;">, where CAPITAL CUP "MINSK-2015"</span></span> was held on <span style="font-weight:bold;">September 26-27</span><span style="font-size:16px;"><span style="line-height:1.5em;">. </span></span>Since all happened very quickly, we did not have time to announce the event. But for now we are ready to show you a photo report of the event and to share the atmosphere of joy and beauty that prevailed during the preparation of the statement made by the participants.</p>

